 package.sentAt,
 package.receivedAt,
 package.dataSourceType,
 package.ediAsnPositionId,
 package.createdAt,
 package.updatedAt,
 package.dockPointId,
 package.delivDate,
 package.isSAPReceived,
 package.sapReceivedAt,
 package.receiverId,
 package.totalQty,
 package.id
FROM
 ( SELECT @rownum := 0 ) r,
 ods_prod.ediasnpackage package
 LEFT JOIN ods_prod.ediasntransport transport ON package.ediasntransportId = transport.id
 LEFT JOIN ods_prod.ediasndeliverynode deliverynode ON package.ediDeliveryNodeId = deliverynode.id
 LEFT JOIN ods_prod.ediasnposition position ON package.delnotepositionid = position.id

